import React from "react";

import { motion } from "framer";

import "./Logo.css";
import engranaje from "../../images/engranaje.png";
import manoDeSpock from "../../images/manoDeSpock.png";

const Logo = () => {
  return (
    <div className="Logo d-flex flex-column align-items-center bg-light justify-content-center p-0 m-0">
      <motion.img
        className="logoImg"
        src={engranaje}
        alt="engranaje de mi logo"
        animate={{ rotate: 720 }}
        transition={{ loop: Infinity, duration: 90 }}
      />
      <motion.img
        className="logoImg"
        src={manoDeSpock}
        alt="mano de Spock"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 3 }}
      />
    </div>
  );
};

export default Logo;
